import { useState } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'

const exampleData = [
  {
    title: "topic one",
    timeEstimate: 5,
    textDescription: "this is topic 1 description"
  },
  {
    title: "topic2",
    timeEstimate: 10,
    textDescription: "this is topic 2 description"
  },
  {
    title: "topic3",
    timeEstimate: 15,
    textDescription: "this is topic 3 description"
  }
]
function App() {
  const [agendaData, setAgendaData] = useState(exampleData)

  return (
    <div id="App">
      <div id='agenda__container'>
        {
          agendaData.map((elm, index) => {
            return (
              <div className='agenda-topic__container' key={elm.title + index}>
                <p>{elm.title}</p>
                <p>{elm.timeEstimate}</p>
                <p>{elm.textDescription}</p>
                <button type="button" class="btn btn-light">Edit</button>
              </div>
            )
          })
        }
        <button type="button" class="btn btn-outline-primary">Primary</button>
<button type="button" class="btn btn-outline-secondary">Secondary</button>
<button type="button" class="btn btn-outline-success">Success</button>
<button type="button" class="btn btn-outline-danger">Danger</button>
<button type="button" class="btn btn-outline-warning">Warning</button>
<button type="button" class="btn btn-outline-info">Info</button>
<button type="button" class="btn btn-outline-light">Light</button>
<button type="button" class="btn btn-outline-dark">Dark</button>
      </div>
    </div>
  );
}

export default App;
